import React, { Component } from "react";
import "./Home.css";

export class Home extends Component {
  constructor(props) {
    super(props);
    this.sayHello = this.sayHello.bind(this);
    this.RedirectToAboutPage = this.RedirectToAboutPage.bind(this);
    this.RedirectToServicesPage = this.RedirectToServicesPage.bind(this);
  }

  sayHello() {
    alert("Hello!");
  }
  RedirectToAboutPage() {
    window.location.href = "./about";
  }
  RedirectToServicesPage() {
    window.location.href = "./services";
  }
  render() {
    return (
      <div className="homepage">
        <div className="jumbotron jumbotron-home">
          <div className="container homepage-content" align="left">
            <div className="row">
              <div className="col-6 smallbox">
                <div className="shade">
                  <div className="header_and_tagline">
                    <h1 className="headermain" align="left">Westwood Electricity</h1>
                    <h3 className="tagmain" align="left">We get to work and get it done!</h3>
                  </div>
                </div>
              </div>
            </div>
            <div className="row button-group">
              <div className="col">
                <div className="btn-toolbar mb-3" align="left">
                  <button
                    type="button"
                    class="btn btn-primary"
                    onClick={this.RedirectToAboutPage}
                  >
                    About Us
                  </button>
                  <button
                    type="button"
                    class="btn btn-primary"
                    onClick={this.RedirectToServicesPage}
                  >
                    Services
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
